import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      rows: <p>This is my row</p>
    };
  }

  render() {
    return (
      <div>
        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img width="50" height="50" src="./search.svg" alt="" />
              </td>
              <td width="10" />
              <td>
                <h1>Movie Digger - The MoviesDB Search</h1>
              </td>
            </tr>
          </tbody>
        </table>

        <input className="searchBar" placeholder="Enter movie name" />
      </div>
    );
  }
}

export default App;
